    false,nt"url": null,nt"notes": "The Refuge completed a Chronic Wasting
    Disease Surveillance and Management Plan (CWD Plan) in 2005. The goals of the Refugeu2019s
    CWD Plan are to: 1) minimize the impact of CWD on ungulate populations that reside
    or frequent refuge lands; 2) to ensure early, rapid, and accurate detection of CWD
    when it does occur on Refuge lands, and 3) to ensure coordination and communication
    with adjacent wildlife management agencies on CWD. Northwest Illinois and Northeast
    Iowa are separated by the Mississippi River and a large proportion of the land within
    the river valley is represented by properties managed by the Upper Mississippi River
    National Wildlife and Fish Refuge (Refuge). Interspersed with Refuge properties
    in the river valley are properties owned by the states of Illinois and Iowa, the
    US Army Corps of Engineers, and private entities. In addition to the bottomland
    forests, wetlands, grasslands and croplands within the river valley, the adjacent
    bluffs along both sides of the valley typically consist of mixed hardwood forests.
    The interspersion of habitat types in the river valley and adjacent bluffs provides
    optimal habitat for white-tailed deer and high deer populations support a substantial
    level of hunting opportunities each year. High deer populations in this region also
    results in a presumably high risk of disease transmission, including transmission
    of Chronic Wasting Disease (CWD).",nt"license_title": "License Not Specified",nt"extras":
